describe('parse', function()
  it('should return a list of items', function()
    local parsed = xml.parse(arraySearchResult)
    assert.array(parsed).has.no.holes()
    assert.is_true(#parsed > 1)
  end)

  it('should return a list of items, even when the query returns only 1 result', function()
    local parsed = xml.parse(arrayPrototypeFilterSearchResult)
    assert.array(parsed).has.no.holes()
    assert.are.equal(1, #parsed)
  end)
end)

describe('transform_items', function()
  it('should transform parsed XML into a list of tables with the right shape', function()
    local parsed = xml.parse(arraySearchResult)
    local transformed = xml.transform_items(parsed, 'javascript')
    assert.truthy(transformed)
    for _, item in pairs(transformed) do
      assert.is_true(item ~= nil)
      assert.are.equal('string', type(item.value))
      assert.are.equal('string', type(item.display))
      assert.are.equal('string', type(item.ordinal))
      assert.are.equal('string', type(item.keyword))
      assert.are.equal('javascript', item.keyword)
    end
  end)
end)
